import Foundation
import simd

/// Lunisolar nutation series.
internal struct LunisolarNutation {
    let Delaunay: [Double]
    let A: vector_double2         // Ai and A''i
    let At: vector_double2        // A'i and A'''i
    let B: vector_double2         // B''i and Bi
    let Bt: vector_double2        // B'''i and B'i
}

/// The planetary nutation series.
internal struct PlanetaryNutation {
    let Delaunay: [Double]
    let A: vector_double2         // Ai and A''i
    let B: vector_double2         // B''i and Bi
}

/// Non-polynomial part of nutation.
internal struct NonPolynomialNutation {
    let C: vector_double2         // C(s, j)_i and C(c, j)_i
    let Delaunay: [Double]
}

